          <div></div>
          <div></div>
        </div>
        <hr />
        <div className="d-flex justify-content-between align-items-center">
          <p>Copyright © 2023 JETOUR.</p>
          <p>Правила использоваия </p>
        </div>
      </div>
    </Style>
  );
};

export default Footer;
